import Header from '../components/Header';
import Footer from '../components/Footer';

function Home({onLogout}){
    return(
        <div>
            <Header onLogout={onLogout}/>
            <article>
                <div id="left">
                    <div id="latestRecipes"></div>
                    <div id="latestCookbooks"></div>
                </div>
                <div id="main">

                </div>
            </article>
            <Footer />
        </div>
    )
}

export default Home;
